■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>汎用ワックス。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0277/3681aj-01.jpg" width="480" height="640"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">JFPA　F☆☆☆☆認定製品<br><br>【取扱上の注意】<br>・荒れ性の方や長時間作業する場合はゴム手袋を着用する。<br>・バクテリア汚染を避けるため、一度容器から出した場合、液をもとの容器に戻さないこと。<br>・他の薬剤・洗浄剤などとは絶対に混ぜたり併用したりしない。<br>【保管】<br>直射日光、40度以上の、多湿および凍結のおそれのある場所を避けて密閉して保管する。</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">深みのある光沢感と他を圧倒する耐久性を発揮し、長期間床の美観を実現できます。汎用ワックスとして高濃度タイプのワンランク上の高品質を実現します。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常納期より3～6日ほど日数が掛かる場合がございます。■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">深みのある光沢感と他を圧倒する耐久性を発揮し、長期間床の美観を実現できます。汎用ワックスとして高濃度タイプのワンランク上の高品質を実現します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">個装サイズ：35×27×29cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：19000g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">金属架橋型アクリルスチレンコポリマー、可塑剤、グリコールエーテル系溶剤、高融点ポリオレフィンワックス、界面活性剤、防腐剤、香料、水</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">使用面積:18Lで約1200～1500平方メートル(1回塗布)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6--><br>【必ずご確認ください】<br>※この商品はメーカーより直送のため、他の商品との同梱はできません<br> ※離島の場合、別途中継料がかかります。<br>※代引でのお支払いはお受けできません。 <br>※お届け先が沖縄・北海道・離島の場合、通常より3～6日ほど日数が掛かる場合がございます。・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
